export const portfolioItems = [
  {
    id: 1,
    title: "Project 1",
    subtitle: "Subtitle 1",
    imageSrc: "assets/img/portfolio/1.jpg",
    modalContent: {
      images: [
        {
          src: "assets/img/portfolio/1-1.jpg",
          alt: "Image 1",
          description: "Description 1",
        },
        {
          src: "assets/img/portfolio/1-2.jpg",
          alt: "Image 2",
